import React, { Component } from 'react';
import styled from 'styled-components'
import anime from 'animejs'
import Typing from 'react-typing-animation';

const Wrapper = styled.div`

    height: 100vh;
    width: 100vw;
    overflow: hidden;
    background-image: url(img/abs1.jpg);
    background-size: cover;

`

const MessageBox = styled.div`

    height: 500px;
    width: 800px;
    border: 1px solid white;
    position: fixed;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);

`

const MessageHeader = styled.div`

    border-bottom: 1px solid white;
    h1 {
        font-weight: normal;
    }

`

class Exp3 extends Component {

    state = {

    }

    componentDidUpdate() {

    }

    componentDidMount() {

        var tl = anime.timeline({
            easing: 'easeOutExpo',
            duration: 750,

        })

        tl.add({
            targets: ".backgroundShape",
            points: [
                { value: ["1000,1000 500,1000 0,1000 0,0 1000,0","1000,1000 500,0 0,1000 0,0 1000,0"]},
            ],
            easing: 'spring(1, 80, 10, 0)',
            duration: 3000,
        })
    }

    render() {
        return (
            <Wrapper>
                <MessageBox>
                    <MessageHeader>
                        <h1>It is very nice to meet you</h1>
                    </MessageHeader>
                    <Typing>Welcome</Typing>
                </MessageBox>
            </Wrapper>
        );
    }

}

export default Exp3;
